import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {locales: []};
  }

  async componentDidMount() {
    client({method: 'GET', path: '/v1/api/locales'}).done(response => {
        this.setState({locales: response.entity._embedded.locales});
    })
  }

  render() {
    return (
        <LocalesList locales={this.state.locales}/>
    )
  }
}

export default App;
